import React from "react";

import axios from 'axios';


export async function axios_post_data_save(data)
{
    await axios.post("http://localhost:8000/data/save", 
        {data: JSON.stringify(data)});
}

export async function axios_get_data_load(data)
{
    const get_data =  await axios.get("http://localhost:8000/data/load", { params: {date: data}});
    return get_data;
}
